B.F8=new A.bd("rio","Rio de Janeiro","Brazil","South America","images/villes/brazil.jpg","images/Pays/brazilFlag.png",5,143,"Rio de Janeiro est c\xe9l\xe8bre pour ses plages iconiques, son \xe9nergie festive, le mont du Pain de Sucre et le Christ R\xe9dempteur. Une ville o\xf9 la nature et la culture br\xe9silienne se rencontrent.","Entre les plages mythiques de Copacabana et d\u2019Ipanema, les vues panoramiques du Pain de Sucre et la statue du Christ R\xe9dempteur, Rio de Janeiro offre un m\xe9lange unique de paysages spectaculaires et d\u2019ambiance urbaine. La ville vibre au rythme de la samba, de son carnaval mondialement connu et de sa vie nocturne anim\xe9e. C\u2019est une destination id\xe9ale pour ceux qui recherchent \xe0 la fois d\xe9tente, culture locale et exp\xe9riences inoubliables.","hero_rio")
B.EQ=new A.bd("bali","Bali","Indonesia","Asia","images/villes/bali1.jpg","images/Pays/indonesiaFlag.png",4.8,210,"Bali est une \xeele tropicale apaisante connue pour ses plages dor\xe9es, ses temples authentiques et ses paysages verdoyants.","Bali est un paradis tropical o\xf9 rizi\xe8res en terrasses, falaises surplombant l\u2019oc\xe9an et temples traditionnels se c\xf4toient. Des villages d\u2019Ubud \xe0 la vie nocturne de Seminyak, l\u2019\xeele m\xe9lange spiritualit\xe9, bien-\xeatre et exploration. C\u2019est une destination parfaite pour pratiquer le yoga, profiter de spas, d\xe9couvrir la cuisine locale et admirer des couchers de soleil spectaculaires.","hero_bali")
B.F2=new A.bd("paris","Paris","France","Europe","images/villes/france.jpg","images/Pays/franceFlag.png",4.9,320,"Paris, la ville lumi\xe8re, s\xe9duit par son architecture \xe9l\xe9gante, ses mus\xe9es embl\xe9matiques et son ambiance romantique.","Entre la tour Eiffel, le Louvre, Notre-Dame et les quais de Seine, Paris offre une richesse culturelle incomparable. La ville est connue pour ses caf\xe9s anim\xe9s, ses p\xe2tisseries, ses boutiques de mode et ses quartiers embl\xe9matiques comme Montmartre ou le Marais. C\u2019est une destination id\xe9ale pour les amoureux d\u2019art, d\u2019histoire, de gastronomie et de balades en ville.","hero_paris")
B.ER=new A.bd("assinie","Assinie","C\xf4te d\u2019Ivoire","Africa","images/villes/assinie1.jpg","images/Pays/civFlag.png",4.7,98,"Assinie est une station baln\xe9aire paisible offrant plages de sable fin, lagunes calmes et h\xf4tels en bord de mer.","Situ\xe9e sur la c\xf4te ivoirienne, Assinie est appr\xe9ci\xe9e pour ses plages tranquilles, ses lagunes et ses h\xe9bergements en bord de l\u2019eau. On y trouve un m\xe9lange d\u2019authenticit\xe9 locale et de confort moderne, parfait pour se d\xe9tendre le week-end ou passer des vacances au calme. Entre balades en bateau, fruits de mer frais et soir\xe9es en terrasse, Assinie est une destination chaleureuse \xe0 d\xe9couvrir.","hero_assinie")
B.EL=new A.bd("new_york","New York","United States","North America","images/villes/NY2.jpg","images/Pays/usaFlag.png",4.8,450,"New York est une m\xe9tropole dynamique connue pour ses gratte-ciel, ses quartiers vibrants et son \xe9nergie in\xe9puisable.","De Times Square \xe0 Central Park, en passant par Brooklyn et la Statue de la Libert\xe9, New York m\xe9lange cultures, cuisines et exp\xe9riences vari\xe9es. La ville ne dort jamais et propose spectacles, mus\xe9es, shopping et gastronomie \xe0 toute heure. Que ce soit pour un s\xe9jour culturel, professionnel ou simplement pour ressentir l\u2019\xe9nergie unique de la ville, New York marque les esprits.","hero_newyork")
B.EP=new A.bd("tokyo","Tokyo","Japan","Asia","images/villes/tokyo2.jpg","images/Pays/japanFlag.png",4.9,380,"Tokyo est une ville o\xf9 technologies futuristes, traditions japonaises et culture pop se rencontrent.","Tokyo offre un contraste fascinant entre gratte-ciel lumineux, temples anciens, jardins zen et quartiers anim\xe9s comme Shibuya ou Akihabara. On y d\xe9couvre une culture riche, une cuisine vari\xe9e (ramen, sushi, street food) et un sens du d\xe9tail unique. C\u2019est une destination id\xe9ale pour les passionn\xe9s de technologie, de culture japonaise et d\u2019exp\xe9riences insolites.","hero_tokyo")
B.F0=new A.bd("cape_town","Cape Town","South Africa","Africa","images/villes/capetown2.jpg","images/Pays/southafricaFlag.png",4.7,175,"Cape Town est une ville c\xf4ti\xe8re entour\xe9e de montagnes, de plages et de paysages naturels impressionnants.","Domin\xe9e par la Table Mountain, Cape Town est une ville color\xe9e situ\xe9e entre mer et montagne. Elle est connue pour ses plages, ses vignobles, son waterfront anim\xe9 et sa diversit\xe9 culturelle. C\u2019est une destination id\xe9ale pour les amateurs de nature, de randonn\xe9es, de bonne cuisine et de vues panoramiques.","hero_capetown")
B.ET=new A.bd("marrakech","Marrakech","Morocco","Africa","images/villes/marrakech2.jpg","images/Pays/moroccoFlag.png",4.6,160,"Marrakech charme par ses souks color\xe9s, ses palais historiques et son ambiance chaleureuse.","Entre la place Jemaa el-Fna, les souks, les riads et les palais, Marrakech est une immersion dans l\u2019art de vivre marocain. On y d\xe9couvre une architecture traditionnelle, une cuisine riche en saveurs et une atmosph\xe8re anim\xe9e du matin au soir. C\u2019est une destination id\xe9ale pour ceux qui aiment les march\xe9s, les d\xe9couvertes culturelles et les exp\xe9riences authentiques.","hero_marrakech")
B.Ey=new A.bd("santorini","Santorini","Greece","Europe","images/villes/santorini2.jpg","images/Pays/greeceFlag.png",4.9,210,"Santorin est une \xeele grecque c\xe9l\xe8bre pour ses maisons blanches, ses toits bleus et ses couchers de soleil sur la mer \xc9g\xe9e.","Perch\xe9e au bord de falaises volcaniques, Santorin offre des vues spectaculaires sur la mer. Ses villages comme Oia et Fira sont connus pour leurs ruelles \xe9troites, leurs \xe9glises aux d\xf4mes bleus et leurs caf\xe9s en terrasse. C\u2019est une destination romantique par excellence, id\xe9ale pour les couples, les photos et les s\xe9jours au calme.","hero_santorini")
B.EC=new A.bd("sydney","Sydney","Australia","Oceania","images/villes/sydney2.jpg","images/Pays/australiaFlag.png",4.8,190,"Sydney est une ville c\xf4ti\xe8re moderne, c\xe9l\xe8bre pour son Op\xe9ra, son port et ses plages comme Bondi.","Sydney combine une architecture moderne, un grand port naturel et des plages mythiques. L\u2019Op\xe9ra de Sydney, le Harbour Bridge, les quartiers comme The Rocks ou Darling Harbour en font une ville agr\xe9able \xe0 d\xe9couvrir. C\u2019est une destination id\xe9ale pour profiter du plein air, de la mer, de la culture et d\u2019un style de vie d\xe9tendu.","hero_sydney")
B.EI=new A.bd("casablanca","Casablanca","Morocco","Africa","images/villes/casablanca1.jpg","images/Pays/moroccoFlag.png",4.5,150,"Casablanca, la perle moderne du Maroc, m\xeale architecture contemporaine et ambiance c\xf4ti\xe8re.","Casablanca est une ville dynamique au bord de l\u2019Atlantique, connue pour sa mosqu\xe9e Hassan II, ses avenues modernes et son m\xe9lange d\u2019histoire et de modernit\xe9. On y d\xe9couvre des restaurants raffin\xe9s, des plages urbaines et une vie nocturne anim\xe9e, id\xe9ale pour les voyageurs en qu\xeate de culture et de d\xe9tente.","hero_casablanca")
B.F3=new A.bd("lagos","Lagos","Nigeria","Africa","images/villes/lagos2.jpg","images/Pays/nigeriaFlag.png",4.6,210,"Lagos est une ville vibrante m\xealant plages dor\xe9es, musique afrobeat et innovation.","Lagos fascine par son \xe9nergie, ses plages comme Tarkwa Bay, ses march\xe9s color\xe9s et son incroyable sc\xe8ne musicale. La ville est un centre culturel et \xe9conomique unique en Afrique, parfait pour d\xe9couvrir l\u2019afrobeat, la gastronomie locale et une cr\xe9ativit\xe9 d\xe9bordante.","hero_lagos")
B.F4=new A.bd("dakar","Dakar","Senegal","Africa","images/villes/dakar1.jpg","images/Pays/senegalFlag.png",4.7,180,"Dakar, ville c\xf4ti\xe8re chaleureuse, est connue pour son ambiance, ses plages et sa culture artistique.","Dakar est une destination ensoleill\xe9e m\xealant march\xe9s, musique traditionnelle, plages et monuments comme le Monument de la Renaissance Africaine. Entre les \xeeles proches, la gastronomie s\xe9n\xe9galaise et les soir\xe9es anim\xe9es, Dakar offre un s\xe9jour authentique et vibrant.","hero_dakar")
B.EH=new A.bd("nairobi","Nairobi","Kenya","Africa","images/villes/nairobi1.jpg","images/Pays/kenyaFlag.png",4.8,240,"Nairobi est la capitale des safaris, alliant ville moderne et nature sauvage.","\xc0 Nairobi, on peut d\xe9couvrir la faune africaine \xe0 proximit\xe9 du centre-ville, visiter le parc national, explorer Karen Blixen ou encore apprendre l\u2019histoire des tribus Maasai. C\u2019est une ville authentique, culturelle et id\xe9ale pour d\xe9buter l\u2019aventure safari.","hero_nairobi")
B.EY=new A.bd("abidjan","Abidjan","C\xf4te d\u2019Ivoire","Africa","images/villes/abidjan1.jpg","images/Pays/civFlag.png",4.7,190,"Abidjan, surnomm\xe9e la \u2018perle des lagunes\u2019, s\xe9duit par son dynamisme et sa gastronomie.","Ville moderne et culturelle, Abidjan offre des quartiers vivants comme Cocody et Plateau, des restaurants vari\xe9s, une ambiance nocturne anim\xe9e et des plages proches. C\u2019est une destination chaleureuse et cosmopolite o\xf9 l\u2019on d\xe9couvre la vraie hospitalit\xe9 ivoirienne.","hero_abidjan")
B.EZ=new A.bd("tunis","Tunis","Tunisia","Africa","images/villes/tunis2.jpg","images/Pays/tunisiaFlag.png",4.6,160,"Tunis charme avec ses m\xe9dinas, ses plages et son histoire mill\xe9naire.","Entre ruelles anciennes, mosqu\xe9es historiques, mus\xe9es et plages m\xe9diterran\xe9ennes, Tunis est une ville riche en patrimoine. L\u2019ancienne Carthage et Sidi Bou Sa\xefd sont des incontournables pour tout visiteur.","hero_tunis")
B.Ex=new A.bd("accra","Accra","Ghana","Africa","images/villes/accra1.jpg","images/Pays/ghanaFlag.png",4.5,170,"Accra offre un m\xe9lange authentique de culture africaine, modernit\xe9 et plages tropicales.","Accra est une capitale accueillante o\xf9 se m\xealent march\xe9s color\xe9s, musique ghan\xe9enne, plages et lieux culturels comme Jamestown. La ville est parfaite pour les voyageurs cherchant une exp\xe9rience africaine chaleureuse et vibrante.","hero_accra")
B.EF=new A.bd("addis_ababa","Addis-Ababa","Ethiopia","Africa","images/villes/addis2.jpg","images/Pays/ethiopiaFlag.png",4.4,140,"Addis-Ababa est un centre historique et culturel unique en Afrique de l\u2019Est.","Connue comme la capitale diplomatique de l\u2019Afrique, Addis-Ababa regorge de mus\xe9es, d\u2019architecture unique et de traditions profondes. C\u2019est un point d\u2019entr\xe9e captivant vers l\u2019histoire \xe9thiopienne et ses hauts plateaux.","hero_addis")
B.EB=new A.bd("windhoek","Windhoek","Namibia","Africa","images/villes/windhoek2.jpg","images/Pays/namibiaFlag.png",4.3,120,"Windhoek, ville paisible, est entour\xe9e de paysages d\xe9sertiques splendides.","Windhoek offre une atmosph\xe8re calme, une architecture allemande unique et un acc\xe8s direct aux plus beaux d\xe9serts d\u2019Afrique : Sossusvlei, Namib et Etosha.","hero_windhoek")
B.EK=new A.bd("seoul","S\xe9oul","South Korea","Asia","images/villes/seoul1.jpg","images/Pays/southkoreaFlag.png",4.9,300,"S\xe9oul m\xe9lange modernit\xe9 futuriste, quartiers anim\xe9s et traditions cor\xe9ennes.","Entre les gratte-ciel de Gangnam, les palais historiques comme Gyeongbokgung, et les rues anim\xe9es de Myeongdong, S\xe9oul est une ville vibrante. La cuisine cor\xe9enne, les caf\xe9s uniques, les march\xe9s traditionnels et la culture K-pop en font une destination incontournable.","hero_seoul")
